import{_ as e,o as i,c as a,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 13.1-1096 Name.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1096.md","filePath":"vacode/13.1-1096.md"}'),o={name:"vacode/13.1-1096.md"},r=t('<h1 id="§-13-1-1096-name" tabindex="-1">§ 13.1-1096 Name. <a class="header-anchor" href="#§-13-1-1096-name" aria-label="Permalink to &quot;§ 13.1-1096 Name.&quot;">​</a></h1><p>A. Except as otherwise provided in subsection B, the name of a protected series shall comply with the provisions of § <a href="/vacode/13.1-1012/">13.1-1012</a>.</p><p>B. The name of a protected series of a series limited liability company shall:</p><ol><li><p>Begin with the name of the series limited liability company, including any words or abbreviation required by subsection A of § <a href="/vacode/13.1-1012/">13.1-1012</a> to designate that the series limited liability company is a limited liability company; and</p></li><li><p>Contain the phrase &quot;protected series&quot; or the abbreviation &quot;P.S.&quot; or &quot;PS.&quot;</p></li></ol><p>C. If a series limited liability company changes its name, the series limited liability company shall deliver to the Commission for filing a statement of designation change for each protected series of the series limited liability company pursuant to subsection D of § <a href="/vacode/13.1-1095/">13.1-1095</a>.</p><p>2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0636" target="_blank" rel="noreferrer">636</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0487" target="_blank" rel="noreferrer">487</a>.</p>',6),s=[r];function n(l,c,p,d,h,m){return i(),a("div",null,s)}const u=e(o,[["render",n]]);export{_ as __pageData,u as default};
